import React, { useEffect, useState } from 'react';

export default function SensorChart() {

    const [age, setAge] = useState(0);

    const increaseAge = () => {
        setAge(age + 1);
    }

    return (
        <div>
            <h1>Age Counter</h1>
            <h2>Age: {age}</h2>
            <button onClick={() => setAge(age + 1)}>Increase Age</button>
        </div>
    );
}
